INSERT INTO meetings (id, title, course_id, meeting_date, start_time, end_time, location, subject, presenter_id, cme_credits, expected_attendees, description, notes, status) VALUES (669, 'Dr Karthik KailashSri Ramachandra University in Chennai', (SELECT id FROM courses WHERE course_number = '75' LIMIT 1), '2024-08-17', NULL, NULL, NULL, NULL, (SELECT id FROM people WHERE first_name = 'Ali' AND last_name = 'Abbasi' LIMIT 1), 0, 0, 'Dear Team (Guess I will take the liberty of addressing the group as such since I am a part now ) My Univ is Sri Ramachandra University in Chennai We have 2300 beds in our hospital and I take pleasure in inviting you all to our Univ soon. I will add in other members to this group and we can begin looking at projects to do together I am sure that we will have a fruitful partnership in the years to come Thank you Hamid for getting me and my team on board Look forward to seeing you all Regards and Cheers  Karthik ---- Dear Team, I am pleased to inform you of our upcoming collaboration with Dr. Kartik Kailash, a distinguished professor from Chennai, India. Following a fruitful discussion, we are planning a visit to India to attend a conference, and concurrently, we aim to visit Chennai University for a live demonstration, cadaver lab, and a lecture for the residents and doctors. I am personally excited about this opportunity. Furthermore, during our meeting, I showcased our artificial intelligence program, Suri, which garnered significant interest from Dr. Kailash''s IT department. They are keen to collaborate on our IT and AI initiatives. Jimmy and Misha, I urge you to establish connections and drive this project. Amanda and Sai, your task is to facilitate the partnership between Chennai University and Avicenna Technical University. This sister university relationship will be pivotal in exchanging knowledge and expertise. Additionally, we are extending an invitation to Dr. Kailash to join our Kambin Society board, contributing to our mission of creating a consortium of surgeons and device representatives. This consortium will be instrumental in providing global access to our protocols, devices, technology, and surgical techniques. Amanda, please coordinate with Dr. Kailash and extend our official invitation for them to visit our Proplaza campus in the United States. Let''s work together to make these initiatives a success. Best regards,', 'Dear Team (Guess I will take the liberty of addressing the group as such since I am a part now ) My Univ is Sri Ramachandra University in Chennai We have 2300 beds in our hospital and I take pleasure in inviting you all to our Univ soon. I will add in other members to this group and we can begin looking at projects to do together I am sure that we will have a fruitful partnership in the years to come Thank you Hamid for getting me and my team on board Look forward to seeing you all Regards and Cheers  Karthik ---- Dear Team, I am pleased to inform you of our upcoming collaboration with Dr. Kartik Kailash, a distinguished professor from Chennai, India. Following a fruitful discussion, we are planning a visit to India to attend a conference, and concurrently, we aim to visit Chennai University for a live demonstration, cadaver lab, and a lecture for the residents and doctors. I am personally excited about this opportunity. Furthermore, during our meeting, I showcased our artificial intelligence program, Suri, which garnered significant interest from Dr. Kailash''s IT department. They are keen to collaborate on our IT and AI initiatives. Jimmy and Misha, I urge you to establish connections and drive this project. Amanda and Sai, your task is to facilitate the partnership between Chennai University and Avicenna Technical University. This sister university relationship will be pivotal in exchanging knowledge and expertise. Additionally, we are extending an invitation to Dr. Kailash to join our Kambin Society board, contributing to our mission of creating a consortium of surgeons and device representatives. This consortium will be instrumental in providing global access to our protocols, devices, technology, and surgical techniques. Amanda, please coordinate with Dr. Kailash and extend our official invitation for them to visit our Proplaza campus in the United States. Let''s work together to make these initiatives a success. Best regards,', 'SCHEDULED');
